webpackJsonp([99305009565609],{772:function(e,t){e.exports={data:{markdownRemark:{html:"<p>I have heard it 1000 times if not more.\nSuccess is an accident.\nFor every 100 things you do, one is bound to be a success.\nThis can be true with songs, relationships, jobs, etc.\nI know, and believe this.</p>\n<p>While listening to the Tim Ferriss podcast with Seth Godin, my mind wandered to these questions:</p>\n<ol>\n<li>Where would I like to be failing?</li>\n<li>Am I failing enough at it?</li>\n</ol>\n<p>Having answers to these questions is important to know at all times.</p>",frontmatter:{title:"Where Can I Fail"},fields:{date:"2016-02-24"}}},pathContext:{url:"/posts/2016-02-24-where-can-i-fail/"}}}});
